import React from 'react'
import CustomSlider from "../slider/custom.slider"
import images from "../data/images";

function Home() {
  return (
    <div>
       <CustomSlider>
        {images.map((image, index) => {
          return <img key={index} src={image.imgURL} alt={image.imgAlt} />;
        })}
      </CustomSlider>
    </div>
  )
}

export default Home
